import styled from 'styled-components';
import {Blueprint, Container, Title1, Ps4Controller} from '../index';

const Etiqueta = styled.div`
    width: 303px;
    height: 303px;
    border: 1px solid #5500ff;
    border-radius: 50%;
`;

const EtiquetaConProps = styled.div`
    width: 303px;
    height: 303px;
    border: 1px solid #00ff55;
    border-radius: 50%;
`;

class Main extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }

    render() {
        return (
            <Container>
                <Etiqueta></Etiqueta>
                <EtiquetaConProps propiedad={true}></EtiquetaConProps>
            </Container>
        );
    }
}

export default Main;
